import React, { useState } from "react";

export default function Temp() {
  const [array, setArray] = useState(["Thing 1", "Thing 2"]);
  function addItem() {
    setArray((item) => [...item, `Thing ${item.length + 1}`]);
  }

  return (
    <div>
      <button onClick={addItem}>Add Item</button>
      <h1 >{array}</h1>
    </div>
  );
}
